window.bookSummaryJSON = "<p>Vampires exist.</p> <p>They use, abuse, and discard.</p> <p>If you are one of the lucky ones to survive a relationship with a vampire but are left feeling broken and desperate, there is help. Hope.</p> <p>The cohort support group meets every Sunday night at the community centre.</p> <p>Refreshments included.</p> <p>Victoria suffered unimaginable horrors and trauma from her four-year relationship with her vampire ex-boyfriend.</p> <p>She was one of the lucky ones.</p> <p>Years later, she enjoys a life of solitude and just wants to be left alone in her new mundane, uneventful life. Her quiet routine shatters to pieces when an unexpected guest joins her vampire victim support group, while an unknown danger stalks her from the shadows.</p> <p>Who is stalking her? Are they connected to her past? Or did her newest member bring more than a century's worth of trauma into her life?</p>"; 
